import React from 'react';
import {
  Switch,
  Route,
} from "react-router-dom";
import Header from './layouts/header';
import CheckIn from './checkIn/checkIn';

function MainStaffs(props) {
  return (
    <div>
     <Header/>
      <Switch>
        <Route exact path="/">
          <CheckIn />
        </Route>
      </Switch>
    </div>
  )
}

export default MainStaffs;
